import{_ as a,o as s,c as e,R as l}from"./chunks/framework.385be6c2.js";const n="/image/git/git_logi.png",b=JSON.parse('{"title":"git 工具使用","description":"","frontmatter":{},"headers":[],"relativePath":"skill/git/index.md","filePath":"skill/git/index.md"}'),t={name:"skill/git/index.md"},p=l('<h1 id="git-工具使用" tabindex="-1">git 工具使用 <a class="header-anchor" href="#git-工具使用" aria-label="Permalink to &quot;git 工具使用&quot;">​</a></h1><p><img src="'+n+`" alt="git_logi"></p><ul><li><a href="https://git-scm.com/about" target="_blank" rel="noreferrer">git 官方文档</a></li><li><a href="https://www.liaoxuefeng.com/wiki/896043488029600" target="_blank" rel="noreferrer">廖雪峰</a></li><li><a href="https://learngitbranching.js.org/?locale=zh_CN" target="_blank" rel="noreferrer">可视化的 git 练习网站</a></li></ul><p>git remote 查看的是主机名<br> git branch 查看的是分支名</p><h2 id="git-提交规范" tabindex="-1">git 提交规范 <a class="header-anchor" href="#git-提交规范" aria-label="Permalink to &quot;git 提交规范&quot;">​</a></h2><ul><li><a href="https://www.conventionalcommits.org/zh-hans/v1.0.0-beta.4/" target="_blank" rel="noreferrer">约定式提交</a></li><li><a href="https://juejin.cn/post/7103170376531705864?searchId=202311140014415A9B5CFFC4867C865C6E" target="_blank" rel="noreferrer">commitlint+husky 约束 git 的 commit</a></li></ul><p>commit 的类型：</p><ul><li>feat: 新功能、新特性</li><li>fix: 修改 bug</li><li>perf: 更改代码，以提高性能（在不影响代码内部行为的前提下，对程序性能进行优化）</li><li>refactor: 代码重构（重构，在不影响代码内部行为、功能下的代码修改）</li><li>docs: 文档修改</li><li>style: 代码格式修改, 注意不是 css 修改（例如分号修改）</li><li>test: 测试用例新增、修改</li><li>build: 影响项目构建或依赖项修改</li><li>revert: 恢复上一次提交</li><li>ci: 持续集成相关文件修改</li><li>chore: 其他修改（不在上述类型中的修改）</li><li>release: 发布新版本</li></ul><h2 id="git-重要命令" tabindex="-1">git 重要命令 <a class="header-anchor" href="#git-重要命令" aria-label="Permalink to &quot;git 重要命令&quot;">​</a></h2><h3 id="git-clone" tabindex="-1">git clone <a class="header-anchor" href="#git-clone" aria-label="Permalink to &quot;git clone&quot;">​</a></h3><p>克隆某资源的版本库，相当于下载别人的代码。</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">clone</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">版本库的网</span><span style="color:#A6ACCD;">址</span><span style="color:#89DDFF;">&gt;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>指定本地目录名</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">clone</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">版本库的网</span><span style="color:#A6ACCD;">址</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">本地目录</span><span style="color:#A6ACCD;">名</span><span style="color:#89DDFF;">&gt;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="git-merge" tabindex="-1">git merge <a class="header-anchor" href="#git-merge" aria-label="Permalink to &quot;git merge&quot;">​</a></h3><p>冲突解决 <a href="https://www.liaoxuefeng.com/wiki/896043488029600/900004111093344" target="_blank" rel="noreferrer">https://www.liaoxuefeng.com/wiki/896043488029600/900004111093344</a></p><h3 id="git-tag" tabindex="-1">git tag <a class="header-anchor" href="#git-tag" aria-label="Permalink to &quot;git tag&quot;">​</a></h3><p>附注标签</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">tag</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-a</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">tagName</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-m</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">标注信息内容</span><span style="color:#89DDFF;">&quot;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>删除本地 tag</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">tag</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-d</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">V1.0.0</span><span style="color:#89DDFF;">&quot;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>删除远程 tag</p><div class="language-shell line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">push</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">origin</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">:refs/tags/v20190514</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="git-flow" tabindex="-1">git flow <a class="header-anchor" href="#git-flow" aria-label="Permalink to &quot;git flow&quot;">​</a></h3><h3 id="git-创建并链接分支" tabindex="-1">git 创建并链接分支 <a class="header-anchor" href="#git-创建并链接分支" aria-label="Permalink to &quot;git 创建并链接分支&quot;">​</a></h3><div class="language-git line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">git</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">// 1,从已有的分支创建新的分支(如从master分支),创建一个dev分支</span></span>
<span class="line"><span style="color:#A6ACCD;">git checkout -b dev</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 2,创建完可以查看一下,分支已经切换到dev</span></span>
<span class="line"><span style="color:#A6ACCD;">git branch</span></span>
<span class="line"><span style="color:#A6ACCD;">dev</span></span>
<span class="line"><span style="color:#A6ACCD;">master</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 3.建立本地到上游（远端）仓的链接 --这样代码才能提交上去</span></span>
<span class="line"><span style="color:#A6ACCD;">git branch --set-upstream-to=origin/dev</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 取消对master的跟踪</span></span>
<span class="line"><span style="color:#A6ACCD;">git branch --unset-upstream master</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br></div></div><h3 id="git-修改本地分支名字" tabindex="-1">git 修改本地分支名字 <a class="header-anchor" href="#git-修改本地分支名字" aria-label="Permalink to &quot;git 修改本地分支名字&quot;">​</a></h3><div class="language-javascript line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">git branch </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;">m 旧本地分支名 新本地分支名</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="git-push-的时候代码与仓库不一致-仓库有文件未拉取到本地" tabindex="-1">git push 的时候代码与仓库不一致（仓库有文件未拉取到本地） <a class="header-anchor" href="#git-push-的时候代码与仓库不一致-仓库有文件未拉取到本地" aria-label="Permalink to &quot;git push 的时候代码与仓库不一致（仓库有文件未拉取到本地）&quot;">​</a></h3><p><a href="https://blog.csdn.net/k_young1997/article/details/90489734" target="_blank" rel="noreferrer">https://blog.csdn.net/k_young1997/article/details/90489734</a></p><p>git pull --rebase origin master</p><h3 id="git-初始化账号密码输入错误-导致绑定失败" tabindex="-1">git 初始化账号密码输入错误，导致绑定失败 <a class="header-anchor" href="#git-初始化账号密码输入错误-导致绑定失败" aria-label="Permalink to &quot;git 初始化账号密码输入错误，导致绑定失败&quot;">​</a></h3><h3 id="git-fetch-和-git-pull-的区别" tabindex="-1">git fetch 和 git pull 的区别 <a class="header-anchor" href="#git-fetch-和-git-pull-的区别" aria-label="Permalink to &quot;git fetch 和 git pull 的区别&quot;">​</a></h3><p>git fetch 是将远程主机的最新内容拉到本地，用户在检查了以后决定是否合并到工作本机分支中。<br> 而 git pull 则是将远程主机的最新内容拉下来后直接合并，即：git pull = git fetch + git merge，这样可能会产生冲突，需要手动解决。</p>`,34),i=[p];function r(o,c,g,h,d,u){return s(),e("div",null,i)}const m=a(t,[["render",r]]);export{b as __pageData,m as default};
